import React from 'react';

const Menu = ({items, category}) => {
  if(category)
  return <div className="section-center">
    {items.map((item) => (
      <div>
        {(item.category == category) ? <h1>{item.title}</h1>: <h1></h1>}
      </div>
    ))}
  </div>
};

export default Menu;
